import React, { Component } from 'react'
import { render } from '@testing-library/react'

export default class NewForm extends React.Component {
    
    state = {
        firstName: '',
        lastName: '',
        email: '',
        username: '',
        password: ''
    }

    render() {
        return(
            <form>
                <input placeholder="First Name" value={this.state.firstName} />
            </form>
        )
    }

}
